    <script>
        // Get all path elements with the 'path-hover' class
        const pathElements = document.querySelectorAll('.path-hover');

        // Get all li elements with the 'data-city' attribute
        const liElements = document.querySelectorAll('[data-city]');

        // Add mouseover event listeners to path elements
        pathElements.forEach(path => {
            path.addEventListener('mouseover', () => {
                const city = path.getAttribute('data-city');
                highlightCity(city);
            });

            path.addEventListener('mouseout', () => {
                clearHighlight();
            });
        });

        // Add mouseover event listeners to li elements
        liElements.forEach(li => {
            li.addEventListener('mouseover', () => {
                const city = li.getAttribute('data-city');
                const h3Element = li.querySelector('h3');
                if (h3Element) {
                    h3Element.classList.add('text-blue-500');
                }
                highlightCity(city);
            });

            li.addEventListener('mouseout', () => {
                const h3Element = li.querySelector('h3');
                if (h3Element) {
                    h3Element.classList.remove('text-blue-500');
                }
                clearHighlight();
            });
        });

        // Function to highlight a city and its corresponding path
        function highlightCity(city) {
            pathElements.forEach(path => {
                if (path.getAttribute('data-city') === city) {
                    path.style.fill = 'blue'; // Change the fill color to highlight the path
                }
            });

            liElements.forEach(li => {
                if (li.getAttribute('data-city') === city) {
                    const h3Element = li.querySelector('h3');
                    if (h3Element) {
                        h3Element.classList.add('text-blue-500'); // Change the text color to highlight the text
                    }
                }
            });
        }

        // Function to clear the highlight
        function clearHighlight() {
            pathElements.forEach(path => {
                path.style.fill = ''; // Clear the fill color
            });

            liElements.forEach(li => {
                const h3Element = li.querySelector('h3');
                if (h3Element) {
                    h3Element.classList.remove('text-blue-500'); // Clear the text color
                }
            });
        }
    </script>
    <script>
        function handleIntersectionFade(entries, observer) {
            entries.forEach(entry => {
                if (entry.isIntersecting) {
                    entry.target.classList.add('opacity-100');
                    observer.unobserve(entry.target);
                }
            });
        }

        function createObserverFade(targetElementId) {
            const options = {
                root: null,
                rootMargin: '0px',
                threshold: 0.3
            };

            const observer = new IntersectionObserver(handleIntersectionFade, options);
            const targetElement = document.getElementById(targetElementId);

            if (targetElement) {
                observer.observe(targetElement);
            }
        }

        createObserverFade('fadeIn-element-1');
        createObserverFade('fadeIn-element-2');
        createObserverFade('fadeIn-element-3');
        createObserverFade('fadeIn-element-4');
    </script>
